import "./ExpensesList.css";

// parent of
import ExpenseItem from "./ExpenseItem";

const ExpensesList = (props) => {  // child of Expenses, props is to receive filteredExpenses aka filteredEXpenses from Expenses
    // use JS logic here to avoid complicated, hard-reading JSX code:
    let filterResult = "";

    if (props.filteredExpenses.length === 0) {
        filterResult = <p>No expense found.</p>;
    } else {
        filterResult = props.filteredExpenses.map((expense) => (
            <ExpenseItem
                key={expense.id}
                title={expense.title}
                amount={expense.amount}
                date={expense.date}
            />
        ));
    }
    return filterResult;
};

export default ExpensesList;
